essentials/getting-started.html.body:
Primeros pasosUtilizaremos ES2015 en el código de los ejemplos en esta guía.Crear una aplicación de una sola página (SPA por sus siglas en inglés) con Vue.js + vue-router es muy sencillo. Con Vue.js, ya estamos estructurando nuestra aplicación con componentes. Cuando agregamos vue-router, todo lo que debemos hacer es mapear nuestros componentes a las rutas e informar a vue-router donde renderizarlas. Aquí hay un ejemplo básico:Todos los ejemplos utilizarán la versión independiente de Vue para hacer posible el análisis de plantillas. Más detalles aquí.HTML



  Hello App!



     será renderizado por defecto como una etiqueta `` -->
    Go to Foo
    Go to Bar




JavaScript// 0. Si utilizas un sistema de empaquetamiento de módulos (por ejemplo, a través de vue-cli), importa Vue y VueRouter y luego ejecuta Vue.use(VueRouter).

// 1. Define componentes de enrutamiento.
// Estos pueden ser importados desde otros archivos
const Foo = { template: 'foo' }
const Bar = { template: 'bar' }

// 2. Define algunas rutas
// Cada ruta debe mapear a un componente. El "componente" puede
// ser un constructor de componente creado a través de
// Vue.extend(), o simplemente un objeto de opciones de componente.
// Más tarde hablaremos acerca de las sub-rutas.
const routes = [
  { path: '/foo', component: Foo },
  { path: '/bar', component: Bar }
]

// 3. Crea una instancia del _router_ y pasa la opción `routes`
// Puedes pasar opciones adicionales aquí,
// pero mantengámoslo simple por el momento.
const router = new VueRouter({
  routes // forma corta para routes: routes
})

// 4. Crea y monta la instancia principal.
// Asegúrate de inyectar el _router_ con la opcion router para
// garantizar que toda la aplicación tenga acceso al mismo.
const app = new Vue({
  router
}).$mount('#app')

// ¡Ahora la aplicación está ejecutándose!
Puedes consultar este ejemplo.Nota que  obtiene automáticamente la clase .router-link-active cuando la ruta a la que apunta es accedida. Puedes leer más acerca de eso en la documentación de la API.

essentials/dynamic-matching.html.body:
Matching dinámico de rutasEs bastante común tener que mapear rutas con un patrón determinado al mismo componente. Por ejemplo, puede que tengamos un componente User el cual debería ser renderizado para todos los usuarios, pero con diferente ID. En vue-router podemos usar un segmento dinámico en el path para lograrlo:const User = {
  template: 'User'
}

const router = new VueRouter({
  routes: [
    // los segmentos dinámicos comienzan con dos puntos
    { path: '/user/:id', component: User }
  ]
})
Ahora, las URL como /user/foo y /user/bar mapearán a la misma ruta.Un segmento dinámico se representa mediante dos puntos :. Cuando se encuentra una coincidencia en la ruta, el valor del segmento dinámico se expondrá como this.$route.params en cada componente. Por lo tanto, podremos renderizar el ID del usuario actual modificando el template de Userde la siguiente manera:const User = {
  template: 'User {{ $route.params.id }}'
}
Puedes consultar el siguiente ejemplo.Se pueden tener múltiples segmentos dinámicos en la misma ruta, y todos serán mapeados a los correspondientes campos en $route.params. Por ejemplo:

patrón
matching de ruta
$route.params

/user/:username
/user/evan
{ username: 'evan' }
/user/:username/post/:post_id
/user/evan/post/123
{ username: 'evan', post_id: 123 }


Además de $route.params, el objeto $route expone más información útil, como $route.query (si hay alguna query en la URL), $route.hash, etc. Puedes verificar todos los detalles en la documentación de la API.Reaccionando ante cambios de los parámetrosUna cosa a tener en cuenta cuando se usan rutas con parámetros es que cuando el usuario navega de /user/foo a /user/bar, la misma instancia del componente será reutilizada. Dado que ambas rutas renderizan el mismo componente, esto es más eficiente que destruir la instancia anterior y crear una nueva. Sin embargo, esto significa que los hooks del ciclo de vida del componentes no serán emitidos.Para detectar cambios en los parámetros en el mismo componente, puedes observar el objeto $route:const User = {
  template: '...',
  watch: {
    '$route' (to, from) {
      // Código que responde al cambio
    }
  }
}
O utiliza el guardia de navegación beforeRouteUpdate introducido en la versión 2.2:const User = {
  template: '...',
  beforeRouteUpdate (to, from, next) {
    // Código que responde al cambio
    // no olvides ejecutar next()
  }
}
Patrones de matching avanzadosvue-router usa path-to-regexp como su motor de búsqueda de patrones, por lo que soporta varios patrones de matching avanzados tales como segmentos dinámicos opcionales, requerimientos del tipo cero o más / uno o más, e incluso patrones regex personalizados. Verifica la  documentación para estos patrones avanzados, y este ejemplo de como usarlos con vue-router.Prioridad en el matching de patronesA veces la misma URL puede coincidir con múltiples rutas. En ese caso, la prioridad se determina por el orden de la definición de las rutas: la primera ruta definida será la que tenga mayor prioridad.

essentials/nested-routes.html.body:
Sub-rutasLas interfaces de usuario (UI por sus siglas en inglés) de aplicaciones reales normalmente están compuestas por componentes que están anidados varios niveles. Es también muy común que los segmentos de una URL correspondan a cierta estructura de componentes anidados, por ejemplo:/user/foo/profile                     /user/foo/posts
+------------------+                  +-----------------+
| User             |                  | User            |
| +--------------+ |                  | +-------------+ |
| | Profile      | |  +------------>  | | Posts       | |
| |              | |                  | |             | |
| +--------------+ |                  | +-------------+ |
+------------------+                  +-----------------+
Con vue-router es muy sencillo expresar esta relación usando configuraciones de sub-rutas.Dada la aplicación que creamos en el capítulo anterior:


const User = {
  template: 'User {{ $route.params.id }}'
}

const router = new VueRouter({
  routes: [
    { path: '/user/:id', component: User }
  ]
})
Aquí,  es un contenedor de nivel superior. Renderiza el componente que coincida con una ruta de nivel superior. Así, un componente renderizado puede contener su propio  anidado. Por ejemplo, si agregamos uno dentro de la plantilla del componente User:const User = {
  template: `

      User {{ $route.params.id }}


  `
}
Para renderizar componentes dentro de este contenedor anidado, necesitamos usar la opción children en la configuración del constructor de VueRouter:const router = new VueRouter({
  routes: [
    { path: '/user/:id', component: User,
      children: [
        {
          // UserProfile será renderizado en el  dentro de User
          // cuando /user/:id/profile coincida
          path: 'profile',
          component: UserProfile
        },
        {
          // UserPosts será renderizado en el  dentro de User
          // cuando /user/:id/posts coincida
          path: 'posts',
          component: UserPosts
        }
      ]
    }
  ]
})
Nota que las sub-rutas que empiecen con / serán tratadas como absolutas. Esto permite aprovechar el anidamiento de componentes sin tener que usar URL anidadas.Como puedes ver, la opción children es simplemente otro array de objetos de configuración de rutas, como routes. Por lo tanto, puedes anidar tantas vistas como necesites.En este punto, con la configuración anterior, cuando visites /user/foo, nada será renderizado dentro del contenedor de  User porque ninguna sub ruta coincidió. Tal vez quieras renderizar algo ahí. En ese caso, puedes pasar una sub ruta vacía:const router = new VueRouter({
  routes: [
    {
      path: '/user/:id', component: User,
      children: [
        // UserHome será renderizado en el  dentro de User
        // cuando /user/:id coincida
        { path: '', component: UserHome },

        // ...otras sub rutas
      ]
    }
  ]
})
Puedes encontrar una demostración de este ejemplo aquí.

essentials/named-routes.html.body:
Rutas con nombreA veces es conveniente identificar una ruta con un nombre, especialmente cuando enlazamos a esa ruta o navegamos mediante código. Puedes darle un nombre a una ruta en las opciones de routes cuando se crea la instancia de Router:const router = new VueRouter({
  routes: [
    {
      path: '/user/:userId',
      name: 'user',
      component: User
    }
  ]
})
Para enlazar a una ruta con nombre, puedes pasar un objeto a la propiedad to del componente router-link:User
Este es exactamente el mismo objeto utilizado mediante código con router.push():router.push({ name: 'user', params: { userId: 123 }})
En ambos casos, el router navegará a la ruta /user/123.Revisa un ejemplo completo aquí.

essentials/named-views.html.body:
Vistas con nombreA veces es necesario mostrar múltiples vistas al mismo tiempo en lugar de anidarlas. Por ejemplo, cuando se crea una plantilla con una vista sidebar y una vista main. Aquí es cuando las vistas con nombre se vuelven útiles. En lugar de tener un solo outlet en tu vista, puedes tener varios y darle a cada uno un nombre diferente. Por defecto, un router-view sin nombre se llamará default.


Una vista se renderiza utilizando un componente, por lo tanto, múltiples vistas requerirán múltiples componentes para la misma ruta. Asegúrate de utilizar la opción components (con una s al final):const router = new VueRouter({
  routes: [
    {
      path: '/',
      components: {
        default: Foo,
        a: Bar,
        b: Baz
      }
    }
  ]
})
Puedes ver una demostración de este ejemplo aquí.

essentials/redirect-and-alias.html.body:
Redireccionamiento y aliasRedireccionamientoEl redireccionamiento también se realiza en la configuración de routes. Para redireccionar desde /a hasta /b:const router = new VueRouter({
  routes: [
    { path: '/a', redirect: '/b' }
  ]
})
EL redireccionamiento también puede apuntar a una ruta con nombre:const router = new VueRouter({
  routes: [
    { path: '/a', redirect: { name: 'foo' }}
  ]
})
O incluso puedes utilizar una función para un redireccionamiento dinámico:const router = new VueRouter({
  routes: [
    { path: '/a', redirect: to => {
      // la función recibe la ruta destino como argumento
      // retorna aquí la ruta de redirección.
    }}
  ]
})
Para otros usos avanzados, tienes el siguiente ejemplo.AliasUna redirección significa que el usuario visita /a, y la URL será reemplazada por /b, para luego ejecutar el código correspondiente a /b. Pero, ¿qué es un alias?Un alias de /a como /b significa que cuando el usuario visita /b, la URL se mantiene como /b, pero el código ejecutado corresponderá al mismo que si el usuario visitase /a.Lo anterior puede ser expresado en la configuración de enrutamiento como:const router = new VueRouter({
  routes: [
    { path: '/a', component: A, alias: '/b' }
  ]
})
Un alias te da la libertad de mapear una estructura de UI a una URL arbitraria, en lugar de estar restringido por la estructura anidada de la configuración.Para otros usos avanzados, aquí tienes un ejemplo.

essentials/passing-props.html.body:
Pasando propiedades a componentes de ruteoUsar $route en tu componente genera un acoplamiento estrecho con la ruta, lo cual limita la flexibilidad del componente dado que solo puede utilizarse en ciertas URL.Para desacoplar el componente del enrutador utiliza props: Acoplado a $routeconst User = {
  template: 'User {{ $route.params.id }}'
}
const router = new VueRouter({
  routes: [
    { path: '/user/:id', component: User }
  ]
})
 Desacoplado con propsconst User = {
  props: ['id'],
  template: 'User {{ id }}'
}
const router = new VueRouter({
  routes: [
    { path: '/user/:id', component: User, props: true }

    // utilizando vistas con nombre, tienes que definir la opción prop para cada una de ellas:
    {
      path: '/user/:id', 
      components: { default: User, sidebar: Sidebar },
      props: { default: true, sidebar: false }
    }
  ]
})
Esto te permite utilizar el componente en cualquier lugar, lo cual hace al mismo reutilizable y más sencillo de testear.Modo booleanCuando props tiene asignado el valor true, route.params serán asignados como las props del componente.Modo objetoCuando props es un objeto, este será asignado tal cual como las props del componente.
Úitl para cuando las props son estáticas.const router = new VueRouter({
  routes: [
    { path: '/promotion/from-newsletter', component: Promotion, props: { newsletterPopup: false } }
  ]
})
Modo funciónPuedes crear una función que retorne props.
Esto te permite convertir los parámetros a otro tipo, combinar valores estáticos con valores basados en rutas, etc.const router = new VueRouter({
  routes: [
    { path: '/search', component: SearchUser, props: (route) => ({ query: route.query.q }) }
  ]
})
La URL: /search?q=vue pasaría {query: "vue"} como props al componente SearchUser.Intenta crear funciones props sin estado, dado que solo se evalúan cuando ocurren cambios de ruta.
Utiliza un componente envolvente si necesitas estado para definir las props, de esa manera Vue puede reaccionar a cambios de estado.Para un uso avanzado, aquí hay un ejemplo.

essentials/history-mode.html.body:
Modo historia HTML5El modo por defecto para vue-router es hash mode - el cual utiliza una almohadilla para simular la URL completa para que la página no sea recargada cuando la URL cambia.Para eliminar la almohadilla, podemos seleccionar el modo historia del router, el cual utiliza el método history.pushState de la API para conseguir una navegación sin recarga de página:const router = new VueRouter({
  mode: 'history',
  routes: [...]
})
Cuando utilices el modo historial, la URL lucirá "normal", por ejemplo: http://oursite.com/user/id. ¡Hermoso!Sin embargo, hay un problema: dado que nuestra aplicación es de una sola página del lado cliente, sin una configuración apropiada del lado servidor los usuarios van a obtener errores 404 si intentan acceder directamente a http://oursite.com/user/id en sus navegadores. Eso es horrible.No hay problema: para solucionar el error, todo lo que debes hacer es agregar un redireccionamiento en tu servidor. Si la URL no coincide con ningún recurso estático, debes apuntar a la misma página index.html donde se encuentra tu aplicación. De nuevo, ¡Hermoso!Ejemplos de configuraciones de servidoresApache
  RewriteEngine On
  RewriteBase /
  RewriteRule ^index\.html$ - [L]
  RewriteCond %{REQUEST_FILENAME} !-f
  RewriteCond %{REQUEST_FILENAME} !-d
  RewriteRule . /index.html [L]

nginxlocation / {
  try_files $uri $uri/ /index.html;
}
Node.js (Express)Para Node.js/Express, considera utilizar el middleware connect-history-api-fallback.DeventajasHay una deventaja para esto: tu servidor ya no reportará errores 404 dado que todas las rutas no encontradas serán redireccionadas al archivo index.html. Para solucionar este problema debes implementar dentro de la aplicación Vue una ruta por defecto para mostrar una página de error 404:const router = new VueRouter({
  mode: 'history',
  routes: [
    { path: '*', component: NotFoundComponent }
  ]
})
Otra solución, si utilizas un servidor Node.js, es utilizar el router del lado del servidor para analizar las URL ingresadas y responder con un error 404 si ninguna ruta coincide.

advanced/navigation-guards.html.body:
Guardias de navegaciónComo el nombre sugiere, las guardias de navegación provistas por vue-router son básicamente utilizadas para proteger rutas de navegación ya sea redireccionando o cancelándolas. Hay varias maneras de engancharse en el proceso de navegación de rutas: globalmente, por ruta o dentro de los componentes.Recuerda: Los cambios en los parámetros o las queries no harán que se ejecuten los guardias de navegación. Simplemente observa el objeto $route para poder reaccionar frente a esos cambios o utiliza el guardia beforeRouteUpdate en el componente.Guardias globalesPuedes registrar guardias before globales utilizando router.beforeEach:const router = new VueRouter({ ... })

router.beforeEach((to, from, next) => {
  // ...
})
Las guardias before globales son llamadas por orden de creación, cuando una navegación comienza. Las guardias pueden ejecutarse asincrónicamente, y la navegación se considera pendiente hasta que todos los hooks sean resueltos.Cada función guardia recibe tres argumentos:to: Route: el Objeto Route hacia donde se navega.
from: Route: la ruta actual desde la cual se navega.
next: Function: esta función debe ser ejecutada para resolver el hook. La acción a realizar depende de los argumentos provistos a next:next(): moverse al siguiente hook en la cadena. Si no queda ninguno, la navegación se confirma.
next(false): cancelar la navegación actual. Si la URL en el navegador cambió (ya sea manualmente o a través del botón atrás), será reseteada al valor de la ruta from.
next('/') o next({ path: '/' }): redirecciona a una ruta diferente. La navegación actual será abortada y una nueva será iniciada.
next(error): (2.4.0+) si el argumento pasado a next es una instancia de Error, la navegación se abortará y el error será pasado a las funciones callback registradas a través de router.onError().

Asegúrese de llamar siempre a la función next, sino el hook nunca será resuelto.Guardias de resolución globalesNuevo en 2.5.0A partir de la versión 2.5.0 puedes registrar un guardia global con router.beforeResolve. Esto es similar a router.beforeEach, con la diferencia que los guardias de resolución serán llamados justo antes de que la navegación sea confirmada, después que todos los guardias en el componente y los componentes de rutas asíncronos sean resueltos.Post hooks globalesTambién puedes registrar hooks globales que se ejecutarán después de que la navegación sea confirmada. Sin embargo, a diferencia de los guardias, estos hooks no reciben una función next y no pueden afectar la navegación:router.afterEach((to, from) => {
  // ...
})
Guardias por rutaPuedes definir guardias beforeEnter directamente en el objeto de configuración de una ruta:const router = new VueRouter({
  routes: [
    {
      path: '/foo',
      component: Foo,
      beforeEnter: (to, from, next) => {
        // ...
      }
    }
  ]
})
Estos guardias tienen exactamente la misma firma que los guardias before globales.Guardias en componentesPor último, puedes directamente definir guardias de navegación dentro de los componentes de ruta (los que son pasados a la configuración del router) con las siguientes opciones:beforeRouteEnter

beforeRouteUpdate (agregado en la versión 2.2)

beforeRouteLeave

const Foo = {
  template: `...`,
  beforeRouteEnter (to, from, next) {
    // se llama antes que la ruta que renderiza este componente sea confirmada.
    // NO tiene acceso a la instancia del componente `this`,
    // ¡porque no ha sido creada todavía cuando este guardia es ejecutado!
  },
  beforeRouteUpdate (to, from, next) {
    // se llama cuando la ruta que renderiza este componente ha cambiado,
    // pero este componente es reusado en la nueva ruta.
    // Por ejemplo, para una ruta con parámetros dinámicos /foo/:id, cuando
    // navegamos desde /foo/1 havia /foo/2, la misma instancia del componente Foo
    // será reusada, y este _hook_ será llamado cuando eso suceda.
    // Tiene acceso a la instancia del componente `this`
  },
  beforeRouteLeave (to, from, next) {
    // se llama cuando la ruta que renderiza el componente está por ser
    // abandonada.
    // Tiene acceso a la instancia del componente `this`
  }
}
La guardia beforeRouteEnter NO tiene acceso a this, porque es ejecutada antes que la navegación sea confirmada, por lo tanto el componente destino todavía no ha sido creado.Sin embargo, puedes acceder a la instancia pasando una función callback a next. La función callback se ejecutará cuando la navegación sea confirmada, y la instancia del componente será pasada como argumento:beforeRouteEnter (to, from, next) {
  next(vm => {
    // accede a la instancia del componente a través de `vm`
  })
}
Puedes acceder directamente a this dentro de beforeRouteLeave. La guardia leave se utiliza normalmente para prevenir al usuario cuando intenta abandonar la ruta accidentalmente sin guardar cambios. La navegación puede ser cancelada ejecutando next(false).El flujo de resolución de navegación completoSe dispara la navegación.

Se llaman a los guardias leave en los componentes desactivados.

Se llaman a los guardias beforeEach globales.

Se llaman a los guardias beforeRouteUpdate en los componentes reutilizados (2.2+).

Se llama a beforeEnter en las configuraciones de rutas.

Se resuelven componentes de rutas asíncronos.

Se llama a beforeRouteEnter en los componentes activados.

Se llama a los guardias globales beforeResolve (2.5+).

Se confirma la navegación.

Se llaman a los hook globalesafterEach.

Se disparan las actualizaciones del DOM.

Se llaman a las funciones callback pasadas a next en los guardias beforeRouteEnter con las instancias creadas.

advanced/meta.html.body:
Campos Meta en las rutasPuedes incluir un campo meta cuando definas una ruta:const router = new VueRouter({
  routes: [
    {
      path: '/foo',
      component: Foo,
      children: [
        {
          path: 'bar',
          component: Bar,
          // campo meta
          meta: { requiresAuth: true }
        }
      ]
    }
  ]
})
Entonces, ¿como accedemos al campo meta?Primero, cada objeto route en la configuración de routes se llama registro de ruta. Los registros de ruta pueden estar anidados. Por lo tanto, cuando una ruta coincida, existe la posibilidad que lo haga con más de un registro de ruta.Por ejemplo, con la configuración anterior, la URL /foo/bar coincidirá tanto con el registro de ruta padre como con el hijo.Todos los registros de rutas que hayan coincidido son expuestos en el objeto $route (y también a los objetos route en las guardias de navegación) como el array $route.matched. Por ende, necesitaremos iterar sobre $route.matched para verificar campos meta en los registros de rutas.Un caso de uso de ejemplo es verificar la existencia de campos metas en los guardias de navegación global:router.beforeEach((to, from, next) => {
  if (to.matched.some(record => record.meta.requiresAuth)) {
    // esta ruta requiere autenticación, verificamos que haya iniciado sesión
    // sino, redirigimos a la página de inicio de sesión.
    if (!auth.loggedIn()) {
      next({
        path: '/login',
        query: { redirect: to.fullPath }
      })
    } else {
      next()
    }
  } else {
    next() // ¡Asegúrate de ejecutar next siempre!
  }
})

