advanced/data-fetching.html.body:
Obtención de datosA veces es necesario obtener datos del servidor cuando una ruta es activada. Por ejemplo, antes de renderizar un perfil de usuario, puedes obtener la información de ese usuario desde el servidor. Podemos lograr esto de dos maneras diferentes:Obtener la información después de la navegación: realiza la navegación primero y luego obtén los datos en un hook del ciclo de vida del componente entrante. Puedes mostrar un indicador de carga mientras se obtienen los datos.
Obtener la información antes de la navegación: Obtén los datos antes de la navegación en la guardia de entrada de la ruta, y realiza la navegación una vez estos obtenidos.
Técnicamente, ambas opciones son válidas - todo depende de la experiencia de usuario a la que apuntes.Obtener la información después de la navegaciónCuando utilizamos este enfoque, navegamos y renderizamos el componente entrante inmediatamente, y obtenemos los datos en el hook created del componente. Esto nos permite mostrar un indicador de estado de carga mientras se obtiene la información desde un servidor remoto, y también manejar la carga de datos según la ruta.Asumamos que tenemos un componente Post que necesita obtener datos de un post basándose en $route.params.id:


      Loading...



      {{ error }}



      {{ post.title }}
      {{ post.body }}



export default {
  data () {
    return {
      loading: false,
      post: null,
      error: null
    }
  },
  created () {
    // obtén los datos cuando la vista es creada y _data_ ya
    // está siendo observada
    this.fetchData()
  },
  watch: {
    // ejecuta nuevamente el método si la ruta cambia
    '$route': 'fetchData'
  },
  methods: {
    fetchData () {
      this.error = this.post = null
      this.loading = true
      // reemplaza getPost con lo que corresponda
      getPost(this.$route.params.id, (err, post) => {
        this.loading = false
        if (err) {
          this.error = err.toString()
        } else {
          this.post = post
        }
      })
    }
  }
}
Obtener la información antes de la navegaciónCon este enfoque, obtenemos la información antes de navegar a la nueva ruta. Podemos obtener los datos en el guardia beforeRouteEnter del componente entrante, y solo ejecutar next cuando se haya completado:export default {
  data () {
    return {
      post: null,
      error: null
    }
  },
  beforeRouteEnter (to, from, next) {
    getPost(to.params.id, (err, post) => {
      next(vm => vm.setData(err, post))
    })
  },
  // cuando la ruta cambie y este componente ya haya sido renderizado,
  // la lógica será ligeramente diferente
  beforeRouteUpdate (to, from, next) {
    this.post = null
    getPost(to.params.id, (err, post) => {
      this.setData(err, post)
      next()
    })
  },
  methods: {
    setData (err, post) {
      if (err) {
        this.error = err.toString()
      } else {
        this.post = post
      }
    }
  }
}
El usuario permanecerá en la vista anterior mientras se esté obteniendo el recurso para la vista entrante. Por lo tanto, es recomendable mostrar algún tipo de indicador o barra de progreso. Si la obtención de datos falla, es necesario mostrar algún tipo de advertencia global.

advanced/scroll-behavior.html.body:
Comportamiento del scrollCuando se utiliza enrutamiento del lado cliente, podemos querer hacer scroll hacia el inicio de la página cuando naveguemos a una nueva ruta, o preservar la posición actual, tal cual lo hace una recarga de la página. vue-router te permite lograr esto e incluso más: permite personalizar completamente el comportamiento del scroll durante la navegación.Nota: esta característica solo funciona en el modo historial de HTML5.Cuando crees una instancia del router, puedes incluir la función scrollBehavior:const router = new VueRouter({
  routes: [...],
  scrollBehavior (to, from, savedPosition) {
    // devolver la posición deseada
  }
})
La función scrollBehavior recibe los objetos de ruta to y from. El tercer parámetro, savedPosition, solo está disponible si estamos en una navegación popstate (cuando se utilizan los botones atrás o adelante en el navegador).La función puede devolver un objeto de posición de scroll. El objeto puede ser de la forma:{ x: number, y: number }

{ selector: string, offset? : { x: number, y: number }} (offset solo soportado a partir de la versión 2.6.0+)

Si se devuelve un valor falso o un objeto vacio, no ocurrirá ningún desplazamiento.Por ejemplo:scrollBehavior (to, from, savedPosition) {
  return { x: 0, y: 0 }
}
Esto hará que la página se desplace hacia el inicio para todas las navegaciones a la ruta.Devolver savedPosition hará que el comportamiento cuando se utilicen los botones atrás o adelante sea el nativo:scrollBehavior (to, from, savedPosition) {
  if (savedPosition) {
    return savedPosition
  } else {
    return { x: 0, y: 0 }
  }
}
Si deseas simular el scroll hacia anclas:scrollBehavior (to, from, savedPosition) {
  if (to.hash) {
    return {
      selector: to.hash
      // , offset: { x: 0, y: 10 }
    }
  }
}
También podemos utilizar campos meta para implementar un control de scroll fino. Un ejemplo completo aquí.

advanced/lazy-loading.html.body:
Lazy loadingCuando se construyen aplicaciones con un sistema de empaquetamiento de módulos, el archivo JavaScript resultante puede terminar siendo muy grande, afectando los tiempos de carga de la página. Sería más eficiente si pudiesemos dividir los componentes de cada ruta en porciones separadas y cargarlas solo cuando esa ruta es visitada.Combinando las características asíncronas de componentes de Vue y las características de división de código de Webpack, es trivial el lazy loading de componentes de ruta.Todo lo que necesitamos es definir nuestros componentes de rutas como asíncronos:const Foo = resolve => {
  // require.ensure es la sintaxis especial de Webpack para indicar un punto de división de código.
  require.ensure(['./Foo.vue'], () => {
    resolve(require('./Foo.vue'))
  })
}
Hay una alternativa a la sintaxis de división de código utilizando require como lo hace AMD, por lo que puede simplificarse como:const Foo = resolve => require(['./Foo.vue'], resolve)
Nada debe cambiarse en la configuración del router, solo utiliza Foo como lo harías normalmente:const router = new VueRouter({
  routes: [
    { path: '/foo', component: Foo }
  ]
})
Agrupando componentes en la misma porciónA veces deseamos agrupar todos los componentes bajo la misma ruta en la misma porción asíncrona. Para lograr esto, necesitamos usar porciones con nombre proveyendo un nombre de porción a require.ensure como el tercer argumento:const Foo = r => require.ensure([], () => r(require('./Foo.vue')), 'group-foo')
const Bar = r => require.ensure([], () => r(require('./Bar.vue')), 'group-foo')
const Baz = r => require.ensure([], () => r(require('./Baz.vue')), 'group-foo')
Webpack agrupará los módulos asíncronos con el mismo nombre dentro de la misma porción asíncrona - esto también significa que no necesitamos más listar explícitamente las dependencias de require.ensure (por lo tanto pasamos un array vacío).

