Opciones del constructor de Routerroutestipo: ArrayDeclaración de tipos para RouteConfig:declare type RouteConfig = {
  path: string;
  component?: Component;
  name?: string; // para rutas con nombre
  components?: { [name: string]: Component }; // para vistas con nombre
  redirect?: string | Location | Function;
  props?: boolean | string | Function;
  alias?: string | Array;
  children?: Array; // para sub-rutas
