router.getMatchedComponents(location?)Devuelve un array de componentes (definiciones/constructores, no instancias) que coincidan con la ubicación provista o la ruta actual. Se utiliza principalmente durante el renderizado del lado servidor para realizar precarga de datos.
router.resolve(location, current?, append?)2.1.0+Resolución inversa de URL. Dada una ubicación de la misma forma que las usadas en , devuelve un objeto con las siguiente propiedades:{
  location: Location;
  route: Route;
