}
router.addRoutes(routes)

2.2.0+Agrega dinámicamente más rutas al router. El argumento debe ser un array utilizando el mismo formato de configuración que las opciones del constructor de routes.
router.onReady(callback, [errorCallback])2.2.0+Este método pone una función callback en espera a ser llamada cuando el router haya completado la navegación inicial, lo cual significa que ya ha resuelto todos los hooks de entrada asíncronos y los componentes asíncronos asociados con la ruta inicial.Esto es útil en el renderizado del lado servidor para asegurar un resultado consistente tanto en el servidor como en el cliente.El segundo argumento, errorCallback, solo es soportado a partir de la versión 2.4. Será llamado cuando la resolución de ruta inicial devuelva un error (por ejemplo, cuando falla la resolución de un componente asíncrono).
router.onError(callback)2.4.0+Registra una función callback la cual será llamada cuando un error es capturado durante la navegación. Ten en cuenta que sucederá solo en las siguientes situaciones:El error es lanzado sincrónicamente dentro de una función de guardia de ruta;
El error es capturado y manejado asíncronamente llamando a next(err) dentro de una función de guardia de ruta;
El error ocurre cuando se intenta resolver un componente asíncrono que es necesario para renderizar una ruta.

api/route-object.html.body:
El objeto RouteUn objeto Route representa el estado de la ruta activa actualmente. Contiene información analizada de la URL actual y los registros de rutas que coinciden con ella.El objeto Route es inmutable. Cada navegación exitosa resultará en un nuevo objeto Route.El objeto Route puede encontrarse en diferentes lugares.Dentro de los componentes, como this.$route
Dentro de las funciones callbacks de observación de $route
Como valor de retorno de la función router.match(location)
Dentro de las guardias de navegación como los primeros dos argumentos:router.beforeEach((to, from, next) => {
  // to y from son objetos de ruta
})
Dentro de la función scrollBehaviorcomo los primeros dos argumentos:

const router = new VueRouter({
  scrollBehavior (to, from, savedPosition) {
    // to y from son objetos de ruta
  }
})

Propiedades del objeto Route$route.pathtipo: stringUna cadena de texto equivalente a la ruta actual, siempre resuelta como una ruta absoluta. Por ejemplo"/foo/bar".

$route.paramstipo: ObjectUn objeto que contiene pares llave/valor de segmentos dinámicos y segmentos estrella. Si no hay parametros, el valor será un objeto vacio.

$route.querytipo: ObjectUn objeto que contiene pares llave/valor del query string. Por ejemplo, para la ruta /foo?user=1, obtendremos $route.query.user == 1. Si no hay query string el valor será un objeto vacio.

$route.hashtipo: stringEl hash de la ruta actual (con la #), si posee. Si no hay un hash el valor será una cadena de texto vacia.

$route.fullPathtipo: stringLa URL completa incluyendo query y hash.

$route.matchedtipo: Array

Un array que contiene registros de ruta para todos los segmentos anidados de la ruta actual. Los registros de ruta son copias de los objetos en el array de configuración routes (y en los arrays children):const router = new VueRouter({
  routes: [
    // el siguiente objeto es un registro de ruta
    { path: '/foo', component: Foo,
      children: [
        // este también es un registro de ruta
        { path: 'bar', component: Bar }
      ]
    }
  ]
})
Cuando la URL es /foo/bar, $route.matched será un array que contendrá ambos objetos (clonados), en orden descendente de padre a hijo.
$route.nameEl nombre de la ruta acutal, si tiene. (Más información en rutas con nombre)
